import styled from "styled-components";

export const MyTeamStyle = styled.div`

    background-image: linear-gradient(#D3D3D3, #808080);
    overflow: hidden;


    .container {
        margin: 0;
        width: 100vw;
        height: 100vh;
        overflow-x: hidden;
        display: flex;
        background: blue;
        justify-content: space-between;
    }

    .jogadores {}


    .campo {
        background: red;
        height: 75%;
        width: 32vw;
        align-itens: center;
        display: flex;
        justify-content: center;
    }

    img {
        widht: 50px;
    }
}

`
